    "2015-09-26T19:38:43.002548",nt"name": "2003-benthic-grab-data-for-catlett-and-goodwin-islands-on-the-york-river-in-chesapeake-bay-virg",nt"isopen":
    false,nt"url": null,nt"notes": "This data set represents the benthic community
    information gathered from grab sampling in 2003 (24 stations). In Fall/Winter 2002,
    researchers from the Virginia Institute of Marine Science (VIMS) and the NOAA Office
    for Coastal Management conducted a project to map benthic habitats by Catlett and
    Goodwin Islands on the York River, Chesapeake Bay, Virginia. Sediment grab samples
    were collected at 56 stations and sediment profile images were collected at 200
    stations. Sampling areas were also surveyed using side scan sonar and multibeam
    bathymetry sensors. Scientists from the Virginia Institute of Marine Sciences returned
    to sample a subset of the 2002 sediment grab data in 2003 and then again in 2004.
    A subset of SPI stations (79) were revisited in 2004.",nt"license_title": null,nt"extras":
